import React, { Component }  from 'react';
import './App.css';
import Header from './components/Header'
import Routes from './components/Nav'
import Footer from './components/Footer'



class App extends Component {
  render() {
    return (
      <div>
        <Header />
        <Routes />
        <Footer />
      </div>
    );
  }
}

export default App;
